import React from 'react';
import SideMenu from '../Components/VerticalMenu/VerticalMenu'; // Make sure to adjust the path based on your project structure
import classes from './NewPage.module.css';
import VerticalMenu from "../Components/VerticalMenu/VerticalMenu"; // Import the styles for the new page

function HomePage() {
    return (
        <div className={classes.newPageContainer}>
            <VerticalMenu patientName="John Doe" clientCode="123456" />
            <div className={classes.pageContent}>
                {/* Add the content of your new page here */}
                <h1>New Page Content</h1>
                {/* ... */}
            </div>
        </div>
    );
}

export default HomePage;
